  [],\n\t\"revision_timestamp\": \"2016-10-01T12:59:38.900634\",\n\t\"name\": \"south-carolina-low-country-complex-fire-management-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the Fire Management Plan
  (FMP) is to provide objectives and guidelines formanaging wildland fire (wildfire
  or prescribed fire) on approximately 99,000 acres of habitat within four National
  Wildlife Refuges that comprise South Carolina Lowcountry Complex (SCLC). The refuges
  in this Complex include; Cape Romain NWR, Ace Basin NWR, Santee NWR and Waccamaw
  NWR. The Complex encompasses 155 square miles of Lowcountry habitat. 28,000 acres
  are congressionally designated wilderness. This plan will meet the US Fish and Wildlife
  Service (USFWS) requirement that all Refuges with vegetation capable of sustaining
  fire will develop a plan to manage fire. The plan replaces previous individual plans
  developed in 2001.The plan is an integral part of the SCLC Comprehensive Conservation
  Plans (CCP) and, along with other step down plans, aids in maintaining a diversity
  of plant and animal communities.This FMP meets the US Fish and Wildlife Service
  (USFWS) requirement that all Refuges with vegetation capable of sustaining fire
  develop a plan to manage fire.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
